Então, no dia seguinte à minha saída, minha mãe apresentou sintoma de gripe/resfriado. Eu não desesperei taaaaaanto pq achei que não daria tempo de eu voltar no domingo a tarde, passar pra ela e já na manhã seguinte ela estar com sintoma, mesmo assim fiquei com um pouco de medo. Mas todos nós aqui de casa ficamos com sintomas de resfriado mesmo. Acabou que não sabemos se foi resfriado em uma baita coincidência, ou se foi covid... por via das dúvidas, ficamos bem quietinhos na nossa.
Eu aparentemente to melhorando tbm (depois de uns dias que minha mãe ficou resfriada, eu tbm fiquei)

